import React, { PureComponent } from "react";
import {
	AreaChart,
	Area,
	XAxis,
	YAxis,
	CartesianGrid,
	Tooltip,
	Legend
} from "recharts";
import axios from "axios";

var data = [];
const serverLocation = require("../../../../src/config/keys").server;

export default class NesreceLeto extends PureComponent {
	state = {
		dataLeto: []
	};

	state = {
		dataLeto: []
	};

	componentDidMount() {
		axios.get(`${serverLocation}/api/graph/23`).then(res => {
			this.setState({ dataLeto: res.data });
			console.log(res.data);
			for (var key in this.state) {
				data.push(this.state[key]);
			}
		});
	}

	render() {
		return (
			<AreaChart
				width={1200}
				height={300}
				data={this.state.dataLeto.podatki}
				margin={{
					top: 10,
					right: 30,
					left: 0,
					bottom: 0
				}}
			>
				<CartesianGrid strokeDasharray="3 3" />
				<XAxis dataKey="leto" />
				<YAxis />
				<Tooltip />
				<Legend />
				<Area
					type="monotone"
					dataKey="nesrece"
					stroke="#66b2b2"
					fill="#66b2b2"
				/>
			</AreaChart>
		);
	}
}
